To explain the issue, we will present a hypothetical scenario of two Rust developers, Will and Maryyann. Will is the maintainer of the books crate, which provides utilities for working with collections of books. Our focus will be on two types PersonalShelf and PublicLibrary, and a method available_books for which books are available. A personal shelf always has all books available. A library has books available if the boolean in a (String, bool) pair is true. Will expresses this idea as follows: // books/lib.rs pub struct PersonalShelf { pub books: Vec<String>
} pub struct PublicLibrary { pub books: Vec<(String, bool)>, } impl PersonalShelf { pub fn available_books(&self) -> impl ExactSizeIterator<Item = &String> { self.books.iter() }
} impl PublicLibrary { pub fn available_books(&self) -> impl Iterator<Item = &String> { self.books.iter() .filter_map(|(book, avail)| avail.then_some(book)) }
} Will wants to create an AvailableBooks trait that captures the shared behavior between the PersonalShelf and PublicLibrary types, like this: // books/lib.rs pub trait AvailableBooks { fn available_books(&self) -> impl Iterator<Item = &String>;
} As of Rust 1.70, this trait will not compile because Rust does not permit trait methods to use impl Trait in return position. The Rust compiler team has a plan to remove this limitation, described in RFC 3425 . However, some design decisions in the RFC are not finalized. This survey will ask you to use your personal experience with Rust to evaluate one such design decision. Say that Rust allowed the AvailableBooks trait to compile as written. Our focus will be on the different possible implementations of AvailableBooks that Will can write. Say he refactors his inherent impls by simply adding AvailableBooks for and changing nothing else, like this: // books/lib.rs impl AvailableBooks for PersonalShelf { pub fn available_books(&self) -> impl ExactSizeIterator<Item = &String> { self.books.iter() }
} impl AvailableBooks for PublicLibrary { pub fn available_books(&self) -> impl Iterator<Item = &String> { self.books.iter() .filter_map(|(book, avail)| avail.then_some(book)) }
} Notice that the trait expects impl Iterator, but the PersonalShelf::available_books implementation provies impl ExactSizeIterator. As a brief refresher, the Iterator trait is the core trait that defines iterable objects. The ExactSizeIterator trait is a sub-trait of Iterator that provides a few additional methods like .len() which returns the length of the iterator. The key design question is: what should Rust do when a trait implementation provides a more specific type than is required in the trait definition? In particular, should an API client be allowed to use knowledge of the more specific type? For now, let's assume that Rust allows Will's implementation to compile, and let's assume that Rust allows any API client of travel to know that PersonalShelf::available_books returns an ExactSizeIterator. To explore this design choice, we will walk through a good situation and a bad situation.

