The Rust developers are considering an additional feature to prevent these kinds of bad situations from happening. Say that Will tries to write a trait implementation returning ExactSizeIterator as before: // books/lib.rs impl AvailableBooks for PersonalShelf { pub fn available_books(&self) -> impl ExactSizeIterator<Item = &String> { self.books.iter() }
} Under this alternative, the Rust compiler would reject this program with the following error: error[EXXX]: the type signature of the implementation of method `available_books` in trait `AvailableBooks` for type `PersonalShelf`... --> lib.rs:8 8 | fn available_books(&self) -> impl ExactSizeIterator<Item = &String> { | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ | | ...is more specific than the type signature of the method | in the trait definition: | --> lib.rs:2 2 | pub trait AvailableBooks { | ... | fn available_books(&self) -> impl Iterator<Item = &String>; | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ | = help: consider adding #[refine] to the implementation As the help message suggests, Will can explicitly write down his intention to expose the fact that ExactSizeIterator should be a public detail by adding the #[refine] attribute, like this: // books/lib.rs impl AvailableBooks for PersonalShelf { #[refine] pub fn available_books(&self) -> impl ExactSizeIterator<Item = &String> { self.books.iter() }
} This implementation is allowed to compile, and Maryyann's program is also allowed to call shelf.available_books().len().
